import React from 'react'
import { NavLink } from 'react-router-dom'

const Error =()=>{
    return(
        <>
        <h1>This page does't Exit</h1>
        <p>Error 404!</p>
        <NavLink to="/">Go Back</NavLink>
        </>
    )
}
export default Error;
